import React from "react";
import Block from "../block/block";
import classes from './Box3x3.module.css'
const Box3x3 = ({click, boxid, id }) => {
    return (
        // Block№n
        // |  LT  T  RT |
        // |  L   M  R  |
        // |  LB  B  RB |
        <div className={classes.outer} id = {id}>
        <div className={classes.block3x1}>
      <Block func={click} id={"LT"+ boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"T" + boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"RT"+ boxid} state={''} box_id={boxid}/>
      </div>
      <div className={classes.block3x1}>
      <Block func={click} id={"L"+ boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"M"+ boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"R"+ boxid} state={''} box_id={boxid}/>
      </div>
      <div className={classes.block3x1}>
      <Block func={click} id={"LB"+ boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"B" + boxid} state={''} box_id={boxid}/>
      <Block func={click} id={"RB"+ boxid} state={''} box_id={boxid}/>
      </div>  
        </div>
    );
};

export default Box3x3;
